Group classification of exemption according to property type and/or owner; the types are defined as:
A – Residential, other than multiple dwellings;
B – New York State government;
C – Municipal governments;
D – U.S., foreign governments, interstate agencies;
E – Private community service and social organizations;
F – Industrial, commercial and public service;
G – Multiple dwellings and urban renewal;
H – Agricultural and forest.

The Thruway classification of the vehicles.
2L = UNDER 7 feet 6 inches in height, 2 axles;
3L = UNDER 7 feet 6 inches in height, 3 axles;
4L = UNDER 7 feet 6 inches in height, 4 or more axles;
2H = 7 feet 6 inches OR GREATER in height, 2 axles;
3H = 7 feet 6 inches OR GREATER in height, 3 axles;
4H = 7 feet 6 inches OR GREATER in height, 4 axles;
5H = 7 feet 6 inches OR GREATER in height, 5 axles;
6H = 7 feet 6 inches OR GREATER in height, 6 axles;
7H = 7 feet 6 inches OR GREATER in height, 7 or more axles
